import React, { useState } from 'react';
import Catalog from "./Catalog";
import SortedTable from "./SortedTable";
import Search from "./Search";

// Главный компонент
const App = () => {
  const [products, setProducts] = useState([
    {
      name: 'Ключ фей',
      cost: 400,
      quantity: 10,
      image: 'key.png',
      description: 'cвойства: открывает практически любой замок, после 2 использований уничтожается',
      isNew: true,
      discount: 10
    },
    {
      name: 'Зелье звёздного света',
      cost: 10,
      quantity: 20,
      image: 'potion.png',
      description: 'Свойства: создаёт сгусток света освещающий все вокруг выпившего в радиусе 50 метров',
      isNew: false,
      discount: 0
    },
    {
      name: 'Товар 3',
      cost: 300,
      quantity: 30,
      image: 'url_изображения_3',
      description: 'Описание: этот револьвер используя простые Патроны без затрат энергии добавляет энерго урон к выстрелам, ствол сменный, однако иных вариантов не нашлось, чуть, что можете обращаться после покупки, может достану. \n' +
          'Характеристики: 100 физ урона 50 энерго урона, кол-во патронов:6, вес 1',
      isNew: true,
      discount: 0
    },
  ]);
  return (
      <div className="App">
        <SortedTable products={products}  />
        <Catalog products={products} />
        <Search products={products} />
      </div>
  );
};

export default App;
